insert  into `pigcms_img`(`id`,`uid`,`uname`,`keyword`,`type`,`text`,`classid`,`classname`,`pic`,`showpic`,`info`,`url`,`createtime`,`uptatetime`,`click`,`token`,`title`,`usort`) values (3,4,'vvint','《利润纵横》课程','2','为什么你辛辛苦苦经营数十年却利润微薄，\r\n　　而有人却轻轻松松赚取着巨额的利润？\r\n\r\n　　为什么你的企业稍有风吹草动便风雨飘摇，\r\n　　而有些企业即便出问题也能安稳如山？',6,'密码课程','http://www.wei0794.com/uploads/h/hwtbjw1397727501/b/f/a/a/thumb_53610c585c71d.jpg','1','&amp;nbsp;为什么你辛辛苦苦经营数十年却利润微薄，&lt;br /&gt;\r\n　　而有人却轻轻松松赚取着巨额的利润？&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　为什么你的企业稍有风吹草动便风雨飘摇，&lt;br /&gt;\r\n　　而有些企业即便出问题也能安稳如山？&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　企业的核心利润究竟来自于哪里？&lt;br /&gt;\r\n　　企业究竟该如何进行顶层设计？&lt;br /&gt;\r\n　　什么才是商业模式设计的核心？&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　老板最首要的任务究竟是什么？&lt;br /&gt;\r\n　　经营团队？创新产品？经营格局？设计模式？&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　老板如何纵横捭阖，让一切资源为我所用？&lt;br /&gt;\r\n　　老板如何设计护城河、烟雾弹，防范风险？&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　小老板还在专注于一城一池的得失，无谓忙碌；&lt;br /&gt;\r\n　　大老板着眼大局，精心设计，环环相扣，不动声色之间，胜败已定！&lt;br /&gt;\r\n&lt;br /&gt;\r\n　　玄机尽在《利润纵横》！&lt;br /&gt;\r\n&lt;div&gt;\r\n	&lt;br /&gt;\r\n&lt;/div&gt;','','1398868292','1398869088',17,'hwtbjw1397727501','《利润纵横》',1),(4,4,'vvint','《突围密码》课程','2','一堂让您醍醐灌顶豁然开朗，颠覆传统思维方式的突围之课！\r\n普通人研究如何做事，高手研究如何经营人，领袖之才必先研究形势！\r\n形势无非围与被围。情感之围、事业之围、健康之围等等等等。',6,'密码课程','http://www.wei0794.com/uploads/h/hwtbjw1397727501/e/0/7/5/thumb_53610f1c6c256.jpg','1','&lt;span style=&quot;background-color:#E53333;font-size:18px;&quot;&gt;&lt;strong&gt;一堂让您醍醐灌顶豁然开朗，颠覆传统思维方式的突围之课！ &amp;nbsp;&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n普通人研究如何做事，高手研究如何经营人，领袖之才必先研究形势！&lt;br /&gt;\r\n形势无非围与被围。情感之围、事业之围、健康之围等等等等。&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;凡成大业者，都是能在关键节点突围的人。&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;刘邦是如何从荥阳成功突围的？&lt;br /&gt;\r\n项羽为何无法从垓下突围成功？&lt;br /&gt;\r\n毛泽东是如何从湘江成功突围的？&lt;br /&gt;\r\n苹果又是如何从诺基亚和摩托罗拉中突围的？&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;不突围，是等死。要么突围而死，要么突围而生！&amp;nbsp;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&amp;nbsp;普通人在规律世界外面，劳心劳力，艰难前行。&lt;br /&gt;\r\n高手进入规律世界，掌握事物核心本质，轻松破除迷障，全面突围！&lt;br /&gt;','','1398869795','1399863690',15,'hwtbjw1397727501','《突围密码》',1),(5,4,'vvint','新闻中心','2','深圳今智塔最新动态',11,'新闻中心','http://www.wei0794.com/uploads/h/hwtbjw1397727501/8/b/a/1/thumb_5369bdae1bbe7.jpg','1','&lt;img src=&quot;/uploads/h/hwtbjw1397727501/5/b/7/2/5369bdce7becf.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/uploads/h/hwtbjw1397727501/4/1/7/e/5369bde29b2f0.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/uploads/h/hwtbjw1397727501/5/5/c/e/5369bdfbe4a1d.jpg&quot; alt=&quot;&quot; /&gt;&lt;img src=&quot;/uploads/h/hwtbjw1397727501/2/f/b/e/5369be1745b2b.jpg&quot; alt=&quot;&quot; /&gt;','','1399438876','1399438876',9,'hwtbjw1397727501','深圳今智塔最新动态',1),(6,4,'vvint','联系我们','2','深圳今智塔联系方式',10,'联系我们','http://www.wei0794.com/uploads/h/hwtbjw1397727501/4/8/e/8/thumb_5369ff21c8fda.jpg','1','&lt;p&gt;\r\n	微信：深圳今智塔（kingstasz）\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	手机：13926520559\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	电话：0755-26050191\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	全国：4008586996\r\n&lt;/p&gt;','','1399455261','1399455604',9,'hwtbjw1397727501','深圳今智塔联系方式',1),(7,4,'vvint','讲师','2','他是培训界新生代领军人物，中国《密码系列课程》原创者！\r\n   如果你还没有上过他的课，你就还不能说自己参加过真正的培训！\r\n   他生于惟楚有才的楚地，古风浩荡的蕲春，与林彪、李时珍同乡。\r\n   他一个外行闯入地板行业，9个月就做到市场第一，被誉为“业内黑马”！\r\n   他独创加减乘除营销模式，3年内成为湖北省市场份额第一名！同行称他“浑水摸鱼”高手！\r\n   他进入培训行业，3年帮公司从600万做到2个亿！\r\n   他公司员工两千多人，自己常年在外碰撞修行，一年在公司时间不超过一个月，业绩却在不断倍增，人称“快乐老板”！\r\n   他单场行销演讲两个小时，成交超过千万，人称“印钞机”！\r\n   他是讲台上的幽默大师周立波，商场上的不败战神“林彪”！上过课的学员称他:“活菩萨”“人生贵人”　',8,'讲师团队','http://www.wei0794.com/uploads/h/hwtbjw1397727501/4/8/e/f/thumb_536a0029b2a53.jpg','1','&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	他是培训界新生代领军人物，中国《密码系列课程》原创者！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;如果你还没有上过他的课，你就还不能说自己参加过真正的培训！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他生于惟楚有才的楚地，古风浩荡的蕲春，与林彪、李时珍同乡。&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他一个外行闯入地板行业，9个月就做到市场第一，被誉为“业内黑马”！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他独创加减乘除营销模式，3年内成为湖北省市场份额第一名！同行称他“浑水摸鱼”高手！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他进入培训行业，3年帮公司从600万做到2个亿！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他公司员工两千多人，自己常年在外碰撞修行，一年在公司时间不超过一个月，业绩却在不断倍增，人称“快乐老板”！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他单场行销演讲两个小时，成交超过千万，人称“印钞机”！&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;他是讲台上的幽默大师周立波，商场上的不败战神“林彪”！上过课的学员称他:“活菩萨”“人生贵人”　\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;strong&gt;亲自主讲课程：&lt;/strong&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&amp;nbsp; &amp;nbsp;《突出重围》、《利润密码》、《人心密码》、《突围密码》、《机制落地》、《天籁之音》。\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;strong&gt;客户评价：&lt;/strong&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&amp;nbsp; &amp;nbsp;“经商十年的经验，不如听王老师三天的课程收获大”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“王老师一个撬动杠杆工具让我一次就签了8000万的单”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“上完老师的策略班，一个月让我公司业绩倍增了16倍”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“最具正义感的导师”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“最能站在国家立场，最具民族情怀的导师”\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	上完王冲老师的课程，让我感受到了什么才是真正的教育培训，什么才是真正的企业导师，我不相信长篇大论，都是纸上谈兵，让我震撼的是培训完后公司的业绩增长了320%，这才是硬道理！\r\n&lt;/div&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	江苏仕德伟集团董事长 ——夏伟量\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	王冲老师您太伟大了，您是我的恩师，听完了您的课公司发生了巨大的改变，营业额一年间增长了80%左右”\r\n&lt;/div&gt;\r\n&lt;div style=&quot;text-align:right;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	中国地产100强旭辉地产集团董事长 ——林中\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	王冲老师是我一辈子的良师益友，上课完后久久不能平静，在企业重要的转型期遇到了杰宝集团的贵人，他给了我方向和力量，2010年企业业绩增长了50%，利润增长了56%；2011年业绩增长了92%，利润同期增长了100%，真心感谢王老师！\r\n&lt;/p&gt;\r\n&lt;div style=&quot;text-align:right;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	上海杰宝大王企业集团有限公司 &amp;nbsp; ——顾杰\r\n&lt;/div&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	从2006年到2009年企业一直没有什么发展，也一直很苦恼，其间也出去学习过，包括北大、清华、浙大、还有国内的一些大师，但都没有解决实际问题，偶然的机会认识了王冲老师，上课第一天很震撼，第二天我把老婆、女儿都请到了课堂，收益非常之大， 2011年底最后3个月创造了经营企业有史以来营业额的奇迹，感谢王老师，呼吁政府机构和更多的优秀企业家一同来聆听王冲老师的《经管密码》。\r\n&lt;/div&gt;\r\n&lt;div style=&quot;text-align:right;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	浙江庆盛控股集团公司董事长 &amp;nbsp;——陈火庆\r\n&lt;/div&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	“这三年来，王老师一直是我的“无冕”私人顾问，他给了我企业发展的核心力量以及未来的准确方向，这三年来企业每年以40%的增长速度发展，2011年底在公司战略会议上，受王老师的启发与影响，我们定下了10年内在中国超过奥的斯的宏伟战略目标，我相信有王冲老师的指引，爱登堡一定可以实现目标与梦想！”\r\n&lt;/div&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/div&gt;\r\n&lt;div style=&quot;text-align:right;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	上海爱登堡电梯股份有限公司董事长 ——李绥\r\n&lt;/div&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	“经过慎重考虑后和尊敬的王冲老师合作，2010年导入了军事化销售骨干团队训练营之后，整个公司发生了翻天覆地的变化，2011年公司营业额在去年的基础上逆势增长了69%，非常感谢王冲老师，以后每年都准备请王冲老师来授课！”\r\n&lt;/div&gt;\r\n&lt;div style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n&lt;/div&gt;\r\n&lt;div style=&quot;text-align:right;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	浙江杭申集团有限公司董事长 ——马传兴\r\n&lt;/div&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	“听完经管密码课程后成本降低25%左右，业绩比培训前翻了一倍，销售从4千万到8千多万，感谢天，感谢地，最终还是感谢王冲老师，是您让我真正地看到了企业的未来。”\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;上海天功坊门业有限公司董事长 ——王永祥\r\n&lt;/p&gt;','','1399455834','1399455834',9,'hwtbjw1397727501','王冲老师',1),(8,4,'vvint','简介','2',' 为什么大多数企业经过短暂的快速发展后，很快就变得缓慢起来？\r\n　　为什么曾经激情无限的创业团队很快就动力不足，无法上下同欲？\r\n　　为什么产品总是缺乏竞争力，市场恶性竞争，成本高昂，利润低下？\r\n　　为什么共同创业的恩爱夫妻创富后，却总是无法同频共振无法和谐幸福？\r\n　　为什么老板可以创立家族企业打下商业江山，却总是无法培养出放心的下一代？',7,'深圳今智塔','http://www.wei0794.com/uploads/h/hwtbjw1397727501/5/b/9/3/thumb_536b0bb1eeb48.jpg','1','&lt;p&gt;\r\n	为什么大多数企业经过短暂的快速发展后，很快就变得缓慢起来？&lt;br /&gt;\r\n　　为什么曾经激情无限的创业团队很快就动力不足，无法上下同欲？&lt;br /&gt;\r\n　　为什么产品总是缺乏竞争力，市场恶性竞争，成本高昂，利润低下？\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n　　为什么共同创业的恩爱夫妻创富后，却总是无法同频共振无法和谐幸福？&lt;br /&gt;\r\n　　为什么老板可以创立家族企业打下商业江山，却总是无法培养出放心的下一代？\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n　　无数的问题正困扰着中国新一代的创富者们，他们拥有勇气和决心，却因为以上种种问题无法解决，在黑暗中苦苦摸索，艰难前行。&lt;br /&gt;\r\n　　宇宙万物皆有规律，掌握规律即一日千里，势如破竹！\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n　　无法掌握规律，犹如真相被设置密码，只有破译密码才能看到事物的真相，直击事物本质！&lt;br /&gt;\r\n　　家和谐则天下和谐！没有任何学问大过生活的学问。&lt;br /&gt;\r\n　　谁能提炼生活的真谛，谁就成为社会真正的大师。谁破译规律，谁就成为时代的引领者！\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n　　培训界新生代领军人物王冲老师，将中华五千年文化的核心精髓进行总结提炼，与当下价值观结合起来，开创密码系列课程，破译红尘一切法相，直接进入人生真谛。\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n　　这套密码课程就老板经营企业、家族传承、夫妻和谐之道等等，以前所未有的角度入手，与时代融合起来，全方位提供了当下中国最新的解决方案，颠覆以往所有似是而非的理论。帮助老板顿悟，轻松经营自己的企业，经营自己的人生和家族，享受到夫妻幸福、家族持续传承，享受到事业帮助自己实现梦想和理想，真正把做企业当成自己的乐趣！&lt;br /&gt;\r\n　　今智塔由此应运而生！\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp; &amp;nbsp;今智塔，寓意当下智慧最高塔。\r\n&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp; &amp;nbsp;公司以“成为全球最影响人的文化传媒集团”为远景，采取全新的商业模式，以培训为平台、以咨询为落地、以影视和传媒作为传播手段，将培训、咨询、影视融合在一起，专注于打造企业核心竞争能力，帮助中国企业提升利润，重建当代企业家的精神信仰世界，帮助更多的中国企业走向世界舞台，将璀璨的中华文化向全世界传播。公司于2012年创造了一年内产值倍增39倍的行业奇迹，已成为中国企业利润提升第一品牌！\r\n&lt;/p&gt;','','1399524296','1399524296',10,'hwtbjw1397727501','深圳今智塔简介',1),(9,4,'vvint','案例','2','上海杰宝大王企业发展有限公司是一家以各类防盗防火保险柜（箱）、银行金库门、保管箱为主导产品的实体防护安防产品的开发和生产企业。公司位于上海市嘉定工业园区内，占地面积近100亩，厂房建筑面积30000平方米，拥有国内一流的标准化保险柜（箱）生产线5条，产品技术研发中心1个，产品质量检测中心1个，公司在国内设有几百家销售网点，形成了覆盖全国的营销及售后服务网络，产品还远销美国、欧洲及东南亚国家和地区。',9,'突围企业','http://www.wei0794.com/uploads/h/hwtbjw1397727501/7/5/d/2/thumb_536b0cc86daa0.jpg','1','&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	上海杰宝大王企业发展有限公司是一家以各类防盗防火保险柜（箱）、银行金库门、保管箱为主导产品的实体防护安防产品的开发和生产企业。公司位于上海市嘉定工业园区内，占地面积近100亩，厂房建筑面积30000平方米，拥有国内一流的标准化保险柜（箱）生产线5条，产品技术研发中心1个，产品质量检测中心1个，公司在国内设有几百家销售网点，形成了覆盖全国的营销及售后服务网络，产品还远销美国、欧洲及东南亚国家和地区。\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	　　企业始终坚持“质量为立业之本，诚信乃成功之道”的宗旨，早在1999年，公司在行业内就率先通过了ISO9001国际质量体系认证，杰宝大王产品在先后获得“上海市名牌产品”和“上海市著名商标”的基础上，通过公司同仁的一致努力，企业又通过了ISO14001环境体系认证，并最终在2007年9月获得了中国产品质量的最高荣誉——“中国名牌”。\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	　　回顾过去，“杰宝”人艰苦创业；展望未来，“杰宝”人满怀信心。公司全体员工将秉承“夯实质量，勇于创新”的企业精神，进一步强化和推广“铸造安全”的品牌形象，保持国内领先，参与国际竞争。力争早日将公司建设成现代化的专业性集团化企业，努力将“杰宝大王”打造成走向世界的中国民族安防品牌！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	&lt;img title=&quot;jbdw1.png&quot; src=&quot;http://www.wechatpen.com/UploadFiles/2014/3/fd74c295-1669-4d05-b58f-de542666c15c.png&quot; border=&quot;0&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;color:#434343;font-family:微软雅黑;background-color:#FFFFFF;&quot;&gt;\r\n	上海杰宝大王企业集团有限公司董事长顾杰说：“王冲老师是我一辈子的良师益友，上课完后久久不能平静，在企业重要的转型期遇到了杰宝集团的贵人，他给了我方向和力量，2010年企业业绩增长了50%，利润增长了56%；2011年业绩增长了92%，利润同期增长了100%，真心感谢王老师！”\r\n&lt;/p&gt;','','1399524564','1399524564',9,'hwtbjw1397727501','【突围企业】上海杰宝大王企业发展有限公司',1),(10,4,'vvint','历史消息','2','温馨提示：请您记得带身份证件，安排酒店住房所需；\r\n请您准备好足够的名片，便于和数百位各行业的企业家相互交流。',12,'历史消息','http://www.wei0794.com/uploads/h/hwtbjw1397727501/3/4/e/5/thumb_536f2ce08fa64.jpg','1','&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他是培训界新生代领军人物，中国《密码系列课程》原创者！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	如果你还没有上过他的课，你就还不能说自己参加过真正的企业家培训！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他一个外行闯入地板行业，9个月就做到市场第一，被誉为“业内黑马”！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他独创加减乘除营销模式，3年内成为省级市场第一名！同行称他“浑水摸鱼”高手！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他公司员工两千多人，自己常年在外碰撞修行，一年在公司时间不超过一个月，业绩却在不断倍增，人称“快乐老板”！\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他的课程具备高度的理论系统，具备切实可行的落地机制。上过课的学员称他:“活菩萨”“人生贵人”\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	他是数家集团公司的终身战略顾问......\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;color:#FF0000;&quot;&gt;亲自主讲课程&lt;/span&gt;&lt;span style=&quot;color:#FF0000;&quot;&gt;：&lt;/span&gt;&lt;/strong&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&amp;nbsp; 《企业利润暴增密码》、《利润设计》、《利润纵横》、《突围密码》、《人心密码》、《天籁之音》\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;color:#FF0000;&quot;&gt;客户评价：&lt;/span&gt;&lt;/strong&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&amp;nbsp; “经商十年的经验，不如听王老师三天的课程收获大”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“王老师一个撬动杠杆工具让我一次就签了8000万的单”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“上完老师的策略班，一个月让我公司业绩倍增了16倍”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“最具正义感的导师”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;“最能站在国家立场，最具民族情怀的导师”\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;strong&gt;&lt;span style=&quot;color:#FF0000;&quot;&gt;【企业家见证】&lt;/span&gt;&lt;/strong&gt; \r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;br /&gt;\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	&lt;img src=&quot;https://mmbiz.qlogo.cn/mmbiz/Mzjj9at2uNb6ibWxHqVfZyiaibmYzEDsVEwU1CLzYib3ibFIv8tXshEUpgmic1tFZCsO5PwYhqiaCOSrvrogiaMAIEiaHXQ/0&quot; /&gt; \r\n&lt;/p&gt;\r\n&lt;table cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; width=&quot;494&quot; style=&quot;color:#000000;font-family:sans-serif;font-size:16px;width:330px;&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot; style=&quot;border:1px solid #DDDDDD;&quot;&gt;\r\n				&lt;p&gt;\r\n					上完王冲老师的课程，让我感受到了什么才是真正的教育培训，什么才是真正的企业导师，我不相信长篇大论，都是纸上谈兵，让我震撼的是培训完后公司的业绩增长了320%，这才是硬道理！\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;江苏仕德伟集团董事长 ——夏伟量\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					王冲老师您太伟大了，您是我的恩师，听完了您的课公司发生了巨大的改变，营业额一年间增长了80%左右” &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&lt;br /&gt;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					中国地产100强旭辉地产集团董事长 ——林中\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					王冲老师是我一辈子的良师益友，上课完后久久不能平静，在企业重要的转型期遇到了杰宝集团的贵人，他给了我方向和力量，2010年企业业绩增长了50%，利润增长了56%；2011年业绩增长了92%，利润同期增长了100%，真心感谢王老师！\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp;上海杰宝大王企业集团有限公司 &amp;nbsp; ——顾杰\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					从2006年到2009年企业一直没有什么发展，也一直很苦恼，其间也出去学习过，包括北大、清华、浙大、还有国内的一些大师，但都没有解决实际问题，偶然的机会认识了王冲老师，上课第一天很震撼，第二天我把老婆、女儿都请到了课堂，收益非常之大， 2011年底最后3个月创造了经营企业有史以来营业额的奇迹，感谢王老师，呼吁政府机构和更多的优秀企业家一同来聆听王冲老师的《经管密码》 &amp;nbsp; &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&lt;br /&gt;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; &amp;nbsp; &amp;nbsp;浙江庆盛控股集团公司董事长 &amp;nbsp;——陈火庆\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					“这三年来，王老师一直是我的“无冕”私人顾问，他给了我企业发展的核心力量以及未来的准确方向，这三年来企业每年以40%的增长速度发展，2011年底在公司战略会议上，受王老师的启发与影响，我们定下了10年内在中国超过奥的斯的宏伟战略目标，我相信有王冲老师的指引，爱登堡一定可以实现目标与梦想！” &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&lt;br /&gt;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					上海爱登堡电梯股份有限公司董事长 ——李绥\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					“经过慎重考虑后和尊敬的王冲老师合作，2010年导入了军事化销售骨干团队训练营之后，整个公司发生了翻天覆地的变化，2011年公司营业额在去年的基础上逆势增长了69%，非常感谢王冲老师，以后每年都准备请王冲老师来授课！” &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; 浙江杭申集团有限公司董事长 ——马传兴\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;494&quot; valign=&quot;top&quot;&gt;\r\n				&lt;p&gt;\r\n					“听完经管密码课程后成本降低25%左右，业绩比培训前翻了一倍，销售从4千万到8千多万，感谢天，感谢地，最终还是感谢王冲老师，是您让我真正地看到了企业的未来。”\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;\r\n				&lt;/p&gt;\r\n				&lt;p&gt;\r\n					上海天功坊门业有限公司董事长 ——王永祥\r\n				&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	关注我们的官方微信深圳今智塔（kingstasz），可以随时获取我们的最新课程信息\r\n&lt;/p&gt;\r\n&lt;p style=&quot;font-family:sans-serif;font-size:16px;&quot;&gt;\r\n	直接回复“预约”，可以直接预约报名\r\n&lt;/p&gt;\r\n&lt;div&gt;\r\n	&lt;br /&gt;\r\n&lt;/div&gt;','','1399794949','1400121042',16,'hwtbjw1397727501','今智塔创始人、华人顶级总裁导师 —— 王冲',1),(12,5,'weikebala','威客巴拉1','2','威客巴拉1',14,'测试','http://www.51pigcms.com/uploads/z/zupohf1482500346/7/4/1/e/thumb_59b7a5920dae6.png','1','威客巴拉1','www.weikebala.cn','1482745761','1505207785',18,'zupohf1482500346','威客巴拉1',1),(13,5,'weikebala','威客巴拉2','2','威客巴拉2',14,'测试','http://www.51pigcms.com/tpl/static/attachment/focus/default/../canyin/1.jpg','1','威客巴拉2dfsdfsdfsdsdffa','','1482745900','1505210431',17,'zupohf1482500346','威客巴拉2',13),(14,5,'weikebala','dsfsf','2','fdsafsdsasf',14,'测试','http://www.51pigcms.com/uploads/z/zupohf1482500346/7/4/1/e/thumb_59b7a5920dae6.png','1','','{siteUrl}/index.php?g=Wap&amp;m=Lottery&amp;a=index&amp;token=zupohf1482500346&amp;wecha_id={wechat_id}&amp;id=1','1505202797','1505207705',0,'zupohf1482500346','sdfsfsadf',14),(15,5,'weikebala','驱寒','2','驱寒',14,'测试','http://www.51pigcms.com/uploads/z/zupohf1482500346/2/3/f/1/thumb_59b8d05143aa7.jpg','1','请填写接口配置信息，此信息需要你有自己的服务器资源，填写的URL需要正确响应微信发送的Token验证，请阅读&lt;a href=&quot;http://mp.weixin.qq.com/wiki/index.php?title=%E6%B6%88%E6%81%AF%E6%8E%A5%E5%8F%A3%E6%8C%87%E5%8D%97&quot; target=&quot;_blank&quot;&gt;消息接口使用指南&lt;/a&gt;。','','1505284207','1505284207',0,'zupohf1482500346','驱寒',15),(16,5,'weikebala','范德萨发的','2','第三方三分',14,'测试','http://www.51pigcms.com/uploads/z/zupohf1482500346/f/c/1/e/thumb_59b8de78c0e78.png','1','发斯蒂芬斯蒂芬','','1505287830','1505287830',0,'zupohf1482500346','发的发生的',16),(17,5,'weikebala','奶粉','2','奶粉奶粉奶粉奶粉',14,'测试','http://www.51pigcms.com/uploads/z/zupohf1482500346/3/1/1/8/thumb_59c089e633643.png','1','','http://m.meilianmeigou.com','1505790470','1505790470',0,'zupohf1482500346','奶粉',17);

